import React from 'react'
import Header from '../components/Header'
import { useNavigation, useLocation } from 'react-router-dom'

const CategoryPage = () => {

  const navigation = useNavigation();
  const location = useLocation();

  return (
    <div>
      <Header/>
      <div
      onClick={() => navigation()}
      >
        Back
      </div>
    </div>
  )
}

export default CategoryPage
